        pending next line.\\n* Fix but in HTTP-digest auth w/ URI having query strings.\\n*
        Fix in Event Hooks section.\\n* Urllib3 update.\\n\\n\\n0.9.1 (2012-01-06)\\n++++++++++++++++++\\n\\n*
        danger_mode for automatic Response.raise_for_status()\\n* Response.iter_lines
