        Response.content = None if there was an invalid response.\\n* Redirection
        auth handling.\\n\\n0.7.4 (2011-10-26)\\n++++++++++++++++++\\n\\n* Session
        Hooks fix.\\n\\n0.7.3 (2011-10-23)\\n++++++++++++++++++\\n\\n* Digest Auth
        fix.\\n\\n\\n0.7.2 (2011-10-23)\\n++++++++++++++++++\\n\\n* PATCH Fix.\\n\\n\\n0.7.1
        (2011-10-23)\\n++++++++++++++++++\\n\\n* Move away from urllib2 authentication
        handling.\\n* Fully Remove AuthManager, AuthObject, &c.\\n* New tuple-based
        auth system with handler callbacks.\\n\\n\\n0.7.0 (2011-10-22)\\n++++++++++++++++++\\n\\n*
        Sessions are now the primary interface.\\n* Deprecated InvalidMethodException.\\n*
        PATCH fix.\\n* New config system (no more global settings).\\n\\n\\n0.6.6
        (2011-10-19)\\n++++++++++++++++++\\n\\n* Session parameter bugfix (params
        merging).\\n\\n\\n0.6.5 (2011-10-18)\\n++++++++++++++++++\\n\\n* Offline (fast)
        test suite.\\n* Session dictionary argument merging.\\n\\n\\n0.6.4 (2011-10-13)\\n++++++++++++++++++\\n\\n*
        Automatic decoding of unicode, based on HTTP Headers.\\n* New ``decode_unicode``
        setting.\\n* Removal of ``r.read/close`` methods.\\n* New ``r.faw`` interface
        for advanced response usage.*\\n* Automatic expansion of parameterized headers.\\n\\n\\n0.6.3
        (2011-10-13)\\n++++++++++++++++++\\n\\n* Beautiful ``requests.async`` module,
        for making async requests w/ gevent.\\n\\n\\n0.6.2 (2011-10-09)\\n++++++++++++++++++\\n\\n*
        GET/HEAD obeys allow_redirects=False.\\n\\n\\n0.6.1 (2011-08-20)\\n++++++++++++++++++\\n\\n*
        Enhanced status codes experience ``\\\\o/``\\n* Set a maximum number of redirects
        (``settings.max_redirects``)\\n* Full Unicode URL support\\n* Support for
        protocol-less redirects.\\n* Allow for arbitrary request types.\\n* Bugfixes\\n\\n\\n0.6.0
        (2011-08-17)\\n++++++++++++++++++\\n\\n* New callback hook system\\n* New
        persistent sessions object and context manager\\n* Transparent Dict-cookie
        handling\\n* Status code reference object\\n* Removed Response.cached\\n*
        Added Response.request\\n* All args are kwargs\\n* Relative redirect support\\n*
        HTTPError handling improvements\\n* Improved https testing\\n* Bugfixes\\n\\n\\n0.5.1
        (2011-07-23)\\n++++++++++++++++++\\n\\n* International Domain Name Support!\\n*
        Access headers without fetching entire body (``read()``)\\n* Use lists as
        dicts for parameters\\n* Add Forced Basic Authentication\\n* Forced Basic
        is default authentication type\\n* ``python-requests.org`` default User-Agent
        header\\n* CaseInsensitiveDict lower-case caching\\n* Response.history bugfix\\n\\n\\n0.5.0
        (2011-06-21)\\n++++++++++++++++++\\n\\n* PATCH Support\\n* Support for Proxies\\n*
        HTTPBin Test Suite\\n* Redirect Fixes\\n* settings.verbose stream writing\\n*
        Querystrings for all methods\\n* URLErrors (Connection Refused, Timeout, Invalid
        URLs) are treated as explicitly raised\\n  ``r.requests.get('hwe://blah');
        r.raise_for_status()``\\n\\n\\n0.4.1 (2011-05-22)\\n++++++++++++++++++\\n\\n*
        Improved Redirection Handling\\n* New 'allow_redirects' param for following
        non-GET/HEAD Redirects\\n* Settings module refactoring\\n\\n\\n0.4.0 (2011-05-15)\\n++++++++++++++++++\\n\\n*
        Response.history: list of redirected responses\\n* Case-Insensitive Header
        Dictionaries!\\n* Unicode URLs\\n\\n\\n0.3.4 (2011-05-14)\\n++++++++++++++++++\\n\\n*
        Urllib2 HTTPAuthentication Recursion fix (Basic/Digest)\\n* Internal Refactor\\n*
        Bytes data upload Bugfix\\n\\n\\n\\n0.3.3 (2011-05-12)\\n++++++++++++++++++\\n\\n*
        Request timeouts\\n* Unicode url-encoded data\\n* Settings context manager
        and module\\n\\n\\n0.3.2 (2011-04-15)\\n++++++++++++++++++\\n\\n* Automatic
        Decompression of GZip Encoded Content\\n* AutoAuth Support for Tupled HTTP
        Auth\\n\\n\\n0.3.1 (2011-04-01)\\n++++++++++++++++++\\n\\n* Cookie Changes\\n*
        Response.read()\\n* Poster fix\\n\\n\\n0.3.0 (2011-02-25)\\n++++++++++++++++++\\n\\n*
        Automatic Authentication API Change\\n* Smarter Query URL Parameterization\\n*
        Allow file uploads and POST data together\\n* New Authentication Manager System\\n
        \   - Simpler Basic HTTP System\\n    - Supports all build-in urllib2 Auths\\n
        \   - Allows for custom Auth Handlers\\n\\n\\n0.2.4 (2011-02-19)\\n++++++++++++++++++\\n\\n*
        Python 2.5 Support\\n* PyPy-c v1.4 Support\\n* Auto-Authentication tests\\n*
        Improved Request object constructor\\n\\n0.2.3 (2011-02-15)\\n++++++++++++++++++\\n\\n*
