        \   - Response.ok (True if expected HTTP Status)\\n    - Response.error (Logged
        HTTPError if bad HTTP Status)\\n    - Response.raise_for_status() (Raises
        stored HTTPError)\\n\\n\\n0.2.2 (2011-02-14)\\n++++++++++++++++++\\n\\n* Still
