        token\\n    '...'\\n    >>> f.decrypt(token)\\n    'A really secret message.
        Not for prying eyes.'\\n\\nYou can find more information in the `documentation`_.\\n\\nYou
        can install ``cryptography`` with:\\n\\n.. code-block:: console\\n\\n    $
