  response:
    body: {string: "{\n    \"info\": {\n        \"maintainer\": \"\", \n        \"docs_url\":
        null, \n        \"requires_python\": \"\", \n        \"maintainer_email\":
        \"\", \n        \"cheesecake_code_kwalitee_id\": null, \n        \"keywords\":
        \"urllib httplib threadsafe filepost http https ssl pooling\", \n        \"package_url\":
        \"http://pypi.python.org/pypi/urllib3\", \n        \"author\": \"Andrey Petrov\",
        \n        \"author_email\": \"andrey.petrov@shazow.net\", \n        \"download_url\":
        \"\", \n        \"platform\": \"\", \n        \"version\": \"1.22\", \n        \"cheesecake_documentation_id\":
        null, \n        \"_pypi_hidden\": false, \n        \"description\": \"urllib3\\n=======\\n\\n..
        image:: https://travis-ci.org/shazow/urllib3.svg?branch=master\\n        :alt:
        Build status on Travis\\n        :target: https://travis-ci.org/shazow/urllib3\\n\\n..
        image:: https://img.shields.io/appveyor/ci/shazow/urllib3/master.svg\\n        :alt:
        Build status on AppVeyor\\n        :target: https://ci.appveyor.com/project/shazow/urllib3\\n\\n..
        image:: https://readthedocs.org/projects/urllib3/badge/?version=latest\\n
        \       :alt: Documentation Status\\n        :target: https://urllib3.readthedocs.io/en/latest/\\n\\n..
        image:: https://img.shields.io/codecov/c/github/shazow/urllib3.svg\\n        :alt:
        Coverage Status\\n        :target: https://codecov.io/gh/shazow/urllib3\\n\\n..
        image:: https://img.shields.io/pypi/v/urllib3.svg?maxAge=86400\\n        :alt:
        PyPI version\\n        :target: https://pypi.python.org/pypi/urllib3\\n\\n..
        image:: https://www.bountysource.com/badge/tracker?tracker_id=192525\\n        :alt:
        Bountysource\\n        :target: https://www.bountysource.com/trackers/192525-urllib3?utm_source=192525&utm_medium=shield&utm_campaign=TRACKER_BADGE\\n\\nurllib3
        is a powerful, *sanity-friendly* HTTP client for Python. Much of the\\nPython
        ecosystem already uses urllib3 and you should too.\\nurllib3 brings many critical
        features that are missing from the Python\\nstandard libraries:\\n\\n- Thread
        safety.\\n- Connection pooling.\\n- Client-side SSL/TLS verification.\\n-
        File uploads with multipart encoding.\\n- Helpers for retrying requests and
        dealing with HTTP redirects.\\n- Support for gzip and deflate encoding.\\n-
        Proxy support for HTTP and SOCKS.\\n- 100% test coverage.\\n\\nurllib3 is
        powerful and easy to use::\\n\\n    >>> import urllib3\\n    >>> http = urllib3.PoolManager()\\n
        \   >>> r = http.request('GET', 'http://httpbin.org/robots.txt')\\n    >>>
        r.status\\n    200\\n    >>> r.data\\n    'User-agent: *\\\\nDisallow: /deny\\\\n'\\n\\nInstalling\\n----------\\n\\nurllib3
        can be installed with `pip <https://pip.pypa.io>`_::\\n\\n    $ pip install
        urllib3\\n\\nAlternatively, you can grab the latest source code from `GitHub
        <https://github.com/shazow/urllib3>`_::\\n\\n    $ git clone git://github.com/shazow/urllib3.git\\n
        \   $ python setup.py install\\n\\n\\nDocumentation\\n-------------\\n\\nurllib3
        has usage and reference documentation at `urllib3.readthedocs.io <https://urllib3.readthedocs.io>`_.\\n\\n\\nContributing\\n------------\\n\\nurllib3
        happily accepts contributions. Please see our\\n`contributing documentation
        <https://urllib3.readthedocs.io/en/latest/contributing.html>`_\\nfor some
        tips on getting started.\\n\\nMaintainers\\n-----------\\n\\n- `@lukasa <https://github.com/lukasa>`_
        (Cory Benfield)\\n- `@sigmavirus24 <https://github.com/sigmavirus24>`_ (Ian
        Cordasco)\\n- `@shazow <https://github.com/shazow>`_ (Andrey Petrov)\\n\\n\\ud83d\\udc4b\\n\\nSponsorship\\n-----------\\n\\nIf
        your company benefits from this library, please consider `sponsoring its\\ndevelopment
        <https://urllib3.readthedocs.io/en/latest/contributing.html#sponsorship>`_.\\n\\n\\nChanges\\n=======\\n\\n1.22
        (2017-07-20)\\n-----------------\\n\\n* Fixed missing brackets in ``HTTP CONNECT``
        when connecting to IPv6 address via\\n  IPv6 proxy. (Issue #1222)\\n\\n* Made
        the connection pool retry on ``SSLError``.  The original ``SSLError``\\n  is
        available on ``MaxRetryError.reason``. (Issue #1112)\\n\\n* Drain and release
        connection before recursing on retry/redirect.  Fixes\\n  deadlocks with a
        blocking connectionpool. (Issue #1167)\\n\\n* Fixed compatibility for cookiejar.
        (Issue #1229)\\n\\n* pyopenssl: Use vendored version of ``six``. (Issue #1231)\\n\\n\\n1.21.1
        (2017-05-02)\\n-------------------\\n\\n* Fixed SecureTransport issue that
        would cause long delays in response body\\n  delivery. (Pull #1154)\\n\\n*
        Fixed regression in 1.21 that threw exceptions when users passed the\\n  ``socket_options``
        flag to the ``PoolManager``.  (Issue #1165)\\n\\n* Fixed regression in 1.21
        that threw exceptions when users passed the\\n  ``assert_hostname`` or ``assert_fingerprint``
        flag to the ``PoolManager``.\\n  (Pull #1157)\\n\\n\\n1.21 (2017-04-25)\\n-----------------\\n\\n*
        Improved performance of certain selector system calls on Python 3.5 and\\n
        \ later. (Pull #1095)\\n\\n* Resolved issue where the PyOpenSSL backend would
        not wrap SysCallError\\n  exceptions appropriately when sending data. (Pull
        #1125)\\n\\n* Selectors now detects a monkey-patched select module after import
        for modules\\n  that patch the select module like eventlet, greenlet. (Pull
        #1128)\\n\\n* Reduced memory consumption when streaming zlib-compressed responses\\n
        \ (as opposed to raw deflate streams). (Pull #1129)\\n\\n* Connection pools
        now use the entire request context when constructing the\\n  pool key. (Pull
        #1016)\\n\\n* ``PoolManager.connection_from_*`` methods now accept a new keyword
        argument,\\n  ``pool_kwargs``, which are merged with the existing ``connection_pool_kw``.\\n
        \ (Pull #1016)\\n\\n* Add retry counter for ``status_forcelist``. (Issue #1147)\\n\\n*
        Added ``contrib`` module for using SecureTransport on macOS:\\n  ``urllib3.contrib.securetransport``.
        \ (Pull #1122)\\n\\n* urllib3 now only normalizes the case of ``http://``
        and ``https://`` schemes:\\n  for schemes it does not recognise, it assumes
        they are case-sensitive and\\n  leaves them unchanged.\\n  (Issue #1080)\\n\\n\\n1.20
        (2017-01-19)\\n-----------------\\n\\n* Added support for waiting for I/O
        using selectors other than select,\\n  improving urllib3's behaviour with
        large numbers of concurrent connections.\\n  (Pull #1001)\\n\\n* Updated the
        date for the system clock check. (Issue #1005)\\n\\n* ConnectionPools now
        correctly consider hostnames to be case-insensitive.\\n  (Issue #1032)\\n\\n*
        Outdated versions of PyOpenSSL now cause the PyOpenSSL contrib module\\n  to
        fail when it is injected, rather than at first use. (Pull #1063)\\n\\n* Outdated
        versions of cryptography now cause the PyOpenSSL contrib module\\n  to fail
        when it is injected, rather than at first use. (Issue #1044)\\n\\n* Automatically
        attempt to rewind a file-like body object when a request is\\n  retried or
        redirected. (Pull #1039)\\n\\n* Fix some bugs that occur when modules incautiously
        patch the queue module.\\n  (Pull #1061)\\n\\n* Prevent retries from occuring
        on read timeouts for which the request method\\n  was not in the method whitelist.
        (Issue #1059)\\n\\n* Changed the PyOpenSSL contrib module to lazily load idna
        to avoid\\n  unnecessarily bloating the memory of programs that don't need
        it. (Pull\\n  #1076)\\n\\n* Add support for IPv6 literals with zone identifiers.
        (Pull #1013)\\n\\n* Added support for socks5h:// and socks4a:// schemes when
        working with SOCKS\\n  proxies, and controlled remote DNS appropriately. (Issue
        #1035)\\n\\n\\n1.19.1 (2016-11-16)\\n-------------------\\n\\n* Fixed AppEngine
        import that didn't function on Python 3.5. (Pull #1025)\\n\\n\\n1.19 (2016-11-03)\\n-----------------\\n\\n*
        urllib3 now respects Retry-After headers on 413, 429, and 503 responses when\\n
        \ using the default retry logic. (Pull #955)\\n\\n* Remove markers from setup.py
        to assist ancient setuptools versions. (Issue\\n  #986)\\n\\n* Disallow superscripts
        and other integerish things in URL ports. (Issue #989)\\n\\n* Allow urllib3's
        HTTPResponse.stream() method to continue to work with\\n  non-httplib underlying
        FPs. (Pull #990)\\n\\n* Empty filenames in multipart headers are now emitted
        as such, rather than\\n  being supressed. (Issue #1015)\\n\\n* Prefer user-supplied
        Host headers on chunked uploads. (Issue #1009)\\n\\n\\n1.18.1 (2016-10-27)\\n-------------------\\n\\n*
        CVE-2016-9015. Users who are using urllib3 version 1.17 or 1.18 along with\\n
        \ PyOpenSSL injection and OpenSSL 1.1.0 *must* upgrade to this version. This\\n
        \ release fixes a vulnerability whereby urllib3 in the above configuration\\n
        \ would silently fail to validate TLS certificates due to erroneously setting\\n
        \ invalid flags in OpenSSL's ``SSL_CTX_set_verify`` function. These erroneous\\n
        \ flags do not cause a problem in OpenSSL versions before 1.1.0, which\\n
        \ interprets the presence of any flag as requesting certificate validation.\\n\\n
        \ There is no PR for this patch, as it was prepared for simultaneous disclosure\\n
        \ and release. The master branch received the same fix in PR #1010.\\n\\n\\n1.18
        (2016-09-26)\\n-----------------\\n\\n* Fixed incorrect message for IncompleteRead
        exception. (PR #973)\\n\\n* Accept ``iPAddress`` subject alternative name
        fields in TLS certificates.\\n  (Issue #258)\\n\\n* Fixed consistency of ``HTTPResponse.closed``
        between Python 2 and 3.\\n  (Issue #977)\\n\\n* Fixed handling of wildcard
        certificates when using PyOpenSSL. (Issue #979)\\n\\n\\n1.17 (2016-09-06)\\n-----------------\\n\\n*
        Accept ``SSLContext`` objects for use in SSL/TLS negotiation. (Issue #835)\\n\\n*
        ConnectionPool debug log now includes scheme, host, and port. (Issue #897)\\n\\n*
        Substantially refactored documentation. (Issue #887)\\n\\n* Used URLFetch
        default timeout on AppEngine, rather than hardcoding our own.\\n  (Issue #858)\\n\\n*
        Normalize the scheme and host in the URL parser (Issue #833)\\n\\n* ``HTTPResponse``
        contains the last ``Retry`` object, which now also\\n  contains retries history.
        (Issue #848)\\n\\n* Timeout can no longer be set as boolean, and must be greater
        than zero.\\n  (PR #924)\\n\\n* Removed pyasn1 and ndg-httpsclient from dependencies
        used for PyOpenSSL. We\\n  now use cryptography and idna, both of which are
        already dependencies of\\n  PyOpenSSL. (PR #930)\\n\\n* Fixed infinite loop
        in ``stream`` when amt=None. (Issue #928)\\n\\n* Try to use the operating
        system's certificates when we are using an\\n  ``SSLContext``. (PR #941)\\n\\n*
        Updated cipher suite list to allow ChaCha20+Poly1305. AES-GCM is preferred
        to\\n  ChaCha20, but ChaCha20 is then preferred to everything else. (PR #947)\\n\\n*
        Updated cipher suite list to remove 3DES-based cipher suites. (PR #958)\\n\\n*
        Removed the cipher suite fallback to allow HIGH ciphers. (PR #958)\\n\\n*
        Implemented ``length_remaining`` to determine remaining content\\n  to be
        read. (PR #949)\\n\\n* Implemented ``enforce_content_length`` to enable exceptions
        when\\n  incomplete data chunks are received. (PR #949)\\n\\n* Dropped connection
        start, dropped connection reset, redirect, forced retry,\\n  and new HTTPS
        connection log levels to DEBUG, from INFO. (PR #967)\\n\\n\\n1.16 (2016-06-11)\\n-----------------\\n\\n*
        Disable IPv6 DNS when IPv6 connections are not possible. (Issue #840)\\n\\n*
        Provide ``key_fn_by_scheme`` pool keying mechanism that can be\\n  overridden.
        (Issue #830)\\n\\n* Normalize scheme and host to lowercase for pool keys,
        and include\\n  ``source_address``. (Issue #830)\\n\\n* Cleaner exception
        chain in Python 3 for ``_make_request``.\\n  (Issue #861)\\n\\n* Fixed installing
        ``urllib3[socks]`` extra. (Issue #864)\\n\\n* Fixed signature of ``ConnectionPool.close``
        so it can actually safely be\\n  called by subclasses. (Issue #873)\\n\\n*
        Retain ``release_conn`` state across retries. (Issues #651, #866)\\n\\n* Add
        customizable ``HTTPConnectionPool.ResponseCls``, which defaults to\\n  ``HTTPResponse``
        but can be replaced with a subclass. (Issue #879)\\n\\n\\n1.15.1 (2016-04-11)\\n-------------------\\n\\n*
        Fix packaging to include backports module. (Issue #841)\\n\\n\\n1.15 (2016-04-06)\\n-----------------\\n\\n*
        Added Retry(raise_on_status=False). (Issue #720)\\n\\n* Always use setuptools,
        no more distutils fallback. (Issue #785)\\n\\n* Dropped support for Python
        3.2. (Issue #786)\\n\\n* Chunked transfer encoding when requesting with ``chunked=True``.\\n
        \ (Issue #790)\\n\\n* Fixed regression with IPv6 port parsing. (Issue #801)\\n\\n*
        Append SNIMissingWarning messages to allow users to specify it in\\n  the
        PYTHONWARNINGS environment variable. (Issue #816)\\n\\n* Handle unicode headers
        in Py2. (Issue #818)\\n\\n* Log certificate when there is a hostname mismatch.
        (Issue #820)\\n\\n* Preserve order of request/response headers. (Issue #821)\\n\\n\\n1.14
        (2015-12-29)\\n-----------------\\n\\n* contrib: SOCKS proxy support! (Issue
        #762)\\n\\n* Fixed AppEngine handling of transfer-encoding header and bug\\n
        \ in Timeout defaults checking. (Issue #763)\\n\\n\\n1.13.1 (2015-12-18)\\n-------------------\\n\\n*
        Fixed regression in IPv6 + SSL for match_hostname. (Issue #761)\\n\\n\\n1.13
        (2015-12-14)\\n-----------------\\n\\n* Fixed ``pip install urllib3[secure]``
        on modern pip. (Issue #706)\\n\\n* pyopenssl: Fixed SSL3_WRITE_PENDING error.
        (Issue #717)\\n\\n* pyopenssl: Support for TLSv1.1 and TLSv1.2. (Issue #696)\\n\\n*
        Close connections more defensively on exception. (Issue #734)\\n\\n* Adjusted
        ``read_chunked`` to handle gzipped, chunk-encoded bodies without\\n  repeatedly
        flushing the decoder, to function better on Jython. (Issue #743)\\n\\n* Accept
        ``ca_cert_dir`` for SSL-related PoolManager configuration. (Issue #758)\\n\\n\\n1.12
        (2015-09-03)\\n-----------------\\n\\n* Rely on ``six`` for importing ``httplib``
        to work around\\n  conflicts with other Python 3 shims. (Issue #688)\\n\\n*
        Add support for directories of certificate authorities, as supported by\\n
        \ OpenSSL. (Issue #701)\\n\\n* New exception: ``NewConnectionError``, raised
        when we fail to establish\\n  a new connection, usually ``ECONNREFUSED`` socket
        error.\\n\\n\\n1.11 (2015-07-21)\\n-----------------\\n\\n* When ``ca_certs``
        is given, ``cert_reqs`` defaults to\\n  ``'CERT_REQUIRED'``. (Issue #650)\\n\\n*
        ``pip install urllib3[secure]`` will install Certifi and\\n  PyOpenSSL as
        dependencies. (Issue #678)\\n\\n* Made ``HTTPHeaderDict`` usable as a ``headers``
        input value\\n  (Issues #632, #679)\\n\\n* Added `urllib3.contrib.appengine
        <https://urllib3.readthedocs.io/en/latest/contrib.html#google-app-engine>`_\\n
        \ which has an ``AppEngineManager`` for using ``URLFetch`` in a\\n  Google
        AppEngine environment. (Issue #664)\\n\\n* Dev: Added test suite for AppEngine.
        (Issue #631)\\n\\n* Fix performance regression when using PyOpenSSL. (Issue
        #626)\\n\\n* Passing incorrect scheme (e.g. ``foo://``) will raise\\n  ``ValueError``
        instead of ``AssertionError`` (backwards\\n  compatible for now, but please
        migrate). (Issue #640)\\n\\n* Fix pools not getting replenished when an error
        occurs during a\\n  request using ``release_conn=False``. (Issue #644)\\n\\n*
        Fix pool-default headers not applying for url-encoded requests\\n  like GET.
        (Issue #657)\\n\\n* log.warning in Python 3 when headers are skipped due to
        parsing\\n  errors. (Issue #642)\\n\\n* Close and discard connections if an
        error occurs during read.\\n  (Issue #660)\\n\\n* Fix host parsing for IPv6
        proxies. (Issue #668)\\n\\n* Separate warning type SubjectAltNameWarning,
        now issued once\\n  per host. (Issue #671)\\n\\n* Fix ``httplib.IncompleteRead``
        not getting converted to\\n  ``ProtocolError`` when using ``HTTPResponse.stream()``\\n
        \ (Issue #674)\\n\\n1.10.4 (2015-05-03)\\n-------------------\\n\\n* Migrate
        tests to Tornado 4. (Issue #594)\\n\\n* Append default warning configuration
        rather than overwrite.\\n  (Issue #603)\\n\\n* Fix streaming decoding regression.
        (Issue #595)\\n\\n* Fix chunked requests losing state across keep-alive connections.\\n
        \ (Issue #599)\\n\\n* Fix hanging when chunked HEAD response has no body.
        (Issue #605)\\n\\n\\n1.10.3 (2015-04-21)\\n-------------------\\n\\n* Emit
        ``InsecurePlatformWarning`` when SSLContext object is missing.\\n  (Issue
        #558)\\n\\n* Fix regression of duplicate header keys being discarded.\\n  (Issue
        #563)\\n\\n* ``Response.stream()`` returns a generator for chunked responses.\\n
        \ (Issue #560)\\n\\n* Set upper-bound timeout when waiting for a socket in
        PyOpenSSL.\\n  (Issue #585)\\n\\n* Work on platforms without `ssl` module
        for plain HTTP requests.\\n  (Issue #587)\\n\\n* Stop relying on the stdlib's
        default cipher list. (Issue #588)\\n\\n\\n1.10.2 (2015-02-25)\\n-------------------\\n\\n*
        Fix file descriptor leakage on retries. (Issue #548)\\n\\n* Removed RC4 from
        default cipher list. (Issue #551)\\n\\n* Header performance improvements.
        (Issue #544)\\n\\n* Fix PoolManager not obeying redirect retry settings. (Issue
        #553)\\n\\n\\n1.10.1 (2015-02-10)\\n-------------------\\n\\n* Pools can be
        used as context managers. (Issue #545)\\n\\n* Don't re-use connections which
        experienced an SSLError. (Issue #529)\\n\\n* Don't fail when gzip decoding
        an empty stream. (Issue #535)\\n\\n* Add sha256 support for fingerprint verification.
        (Issue #540)\\n\\n* Fixed handling of header values containing commas. (Issue
        #533)\\n\\n\\n1.10 (2014-12-14)\\n-----------------\\n\\n* Disabled SSLv3.
        (Issue #473)\\n\\n* Add ``Url.url`` property to return the composed url string.
        (Issue #394)\\n\\n* Fixed PyOpenSSL + gevent ``WantWriteError``. (Issue #412)\\n\\n*
        ``MaxRetryError.reason`` will always be an exception, not string.\\n  (Issue
        #481)\\n\\n* Fixed SSL-related timeouts not being detected as timeouts. (Issue
        #492)\\n\\n* Py3: Use ``ssl.create_default_context()`` when available. (Issue
        #473)\\n\\n* Emit ``InsecureRequestWarning`` for *every* insecure HTTPS request.\\n
        \ (Issue #496)\\n\\n* Emit ``SecurityWarning`` when certificate has no ``subjectAltName``.\\n
        \ (Issue #499)\\n\\n* Close and discard sockets which experienced SSL-related
        errors.\\n  (Issue #501)\\n\\n* Handle ``body`` param in ``.request(...)``.
        (Issue #513)\\n\\n* Respect timeout with HTTPS proxy. (Issue #505)\\n\\n*
        PyOpenSSL: Handle ZeroReturnError exception. (Issue #520)\\n\\n\\n1.9.1 (2014-09-13)\\n------------------\\n\\n*
        Apply socket arguments before binding. (Issue #427)\\n\\n* More careful checks
        if fp-like object is closed. (Issue #435)\\n\\n* Fixed packaging issues of
        some development-related files not\\n  getting included. (Issue #440)\\n\\n*
        Allow performing *only* fingerprint verification. (Issue #444)\\n\\n* Emit
        ``SecurityWarning`` if system clock is waaay off. (Issue #445)\\n\\n* Fixed
        PyOpenSSL compatibility with PyPy. (Issue #450)\\n\\n* Fixed ``BrokenPipeError``
        and ``ConnectionError`` handling in Py3.\\n  (Issue #443)\\n\\n\\n\\n1.9 (2014-07-04)\\n----------------\\n\\n*
        Shuffled around development-related files. If you're maintaining a distro\\n
        \ package of urllib3, you may need to tweak things. (Issue #415)\\n\\n* Unverified
        HTTPS requests will trigger a warning on the first request. See\\n  our new
        `security documentation\\n  <https://urllib3.readthedocs.io/en/latest/security.html>`_
        for details.\\n  (Issue #426)\\n\\n* New retry logic and ``urllib3.util.retry.Retry``
        configuration object.\\n  (Issue #326)\\n\\n* All raised exceptions should
        now wrapped in a\\n  ``urllib3.exceptions.HTTPException``-extending exception.
        (Issue #326)\\n\\n* All errors during a retry-enabled request should be wrapped
        in\\n  ``urllib3.exceptions.MaxRetryError``, including timeout-related exceptions\\n
        \ which were previously exempt. Underlying error is accessible from the\\n
        \ ``.reason`` propery. (Issue #326)\\n\\n* ``urllib3.exceptions.ConnectionError``
        renamed to\\n  ``urllib3.exceptions.ProtocolError``. (Issue #326)\\n\\n* Errors
        during response read (such as IncompleteRead) are now wrapped in\\n  ``urllib3.exceptions.ProtocolError``.
        (Issue #418)\\n\\n* Requesting an empty host will raise ``urllib3.exceptions.LocationValueError``.\\n
        \ (Issue #417)\\n\\n* Catch read timeouts over SSL connections as\\n  ``urllib3.exceptions.ReadTimeoutError``.
        (Issue #419)\\n\\n* Apply socket arguments before connecting. (Issue #427)\\n\\n\\n1.8.3
        (2014-06-23)\\n------------------\\n\\n* Fix TLS verification when using a
        proxy in Python 3.4.1. (Issue #385)\\n\\n* Add ``disable_cache`` option to
        ``urllib3.util.make_headers``. (Issue #393)\\n\\n* Wrap ``socket.timeout``
        exception with\\n  ``urllib3.exceptions.ReadTimeoutError``. (Issue #399)\\n\\n*
        Fixed proxy-related bug where connections were being reused incorrectly.\\n
        \ (Issues #366, #369)\\n\\n* Added ``socket_options`` keyword parameter which
        allows to define\\n  ``setsockopt`` configuration of new sockets. (Issue #397)\\n\\n*
        Removed ``HTTPConnection.tcp_nodelay`` in favor of\\n  ``HTTPConnection.default_socket_options``.
        (Issue #397)\\n\\n* Fixed ``TypeError`` bug in Python 2.6.4. (Issue #411)\\n\\n\\n1.8.2
        (2014-04-17)\\n------------------\\n\\n* Fix ``urllib3.util`` not being included
        in the package.\\n\\n\\n1.8.1 (2014-04-17)\\n------------------\\n\\n* Fix
        AppEngine bug of HTTPS requests going out as HTTP. (Issue #356)\\n\\n* Don't
        install ``dummyserver`` into ``site-packages`` as it's only needed\\n  for
        the test suite. (Issue #362)\\n\\n* Added support for specifying ``source_address``.
        (Issue #352)\\n\\n\\n1.8 (2014-03-04)\\n----------------\\n\\n* Improved url
        parsing in ``urllib3.util.parse_url`` (properly parse '@' in\\n  username,
        and blank ports like 'hostname:').\\n\\n* New ``urllib3.connection`` module
        which contains all the HTTPConnection\\n  objects.\\n\\n* Several ``urllib3.util.Timeout``-related
        fixes. Also changed constructor\\n  signature to a more sensible order. [Backwards
        incompatible]\\n  (Issues #252, #262, #263)\\n\\n* Use ``backports.ssl_match_hostname``
        if it's installed. (Issue #274)\\n\\n* Added ``.tell()`` method to ``urllib3.response.HTTPResponse``
        which\\n  returns the number of bytes read so far. (Issue #277)\\n\\n* Support
        for platforms without threading. (Issue #289)\\n\\n* Expand default-port comparison
        in ``HTTPConnectionPool.is_same_host``\\n  to allow a pool with no specified
        port to be considered equal to to an\\n  HTTP/HTTPS url with port 80/443 explicitly
        provided. (Issue #305)\\n\\n* Improved default SSL/TLS settings to avoid vulnerabilities.\\n
        \ (Issue #309)\\n\\n* Fixed ``urllib3.poolmanager.ProxyManager`` not retrying
        on connect errors.\\n  (Issue #310)\\n\\n* Disable Nagle's Algorithm on the
        socket for non-proxies. A subset of requests\\n  will send the entire HTTP
        request ~200 milliseconds faster; however, some of\\n  the resulting TCP packets
        will be smaller. (Issue #254)\\n\\n* Increased maximum number of SubjectAltNames
        in ``urllib3.contrib.pyopenssl``\\n  from the default 64 to 1024 in a single
        certificate. (Issue #318)\\n\\n* Headers are now passed and stored as a custom\\n
        \ ``urllib3.collections_.HTTPHeaderDict`` object rather than a plain ``dict``.\\n
        \ (Issue #329, #333)\\n\\n* Headers no longer lose their case on Python 3.
        (Issue #236)\\n\\n* ``urllib3.contrib.pyopenssl`` now uses the operating system's
        default CA\\n  certificates on inject. (Issue #332)\\n\\n* Requests with ``retries=False``
        will immediately raise any exceptions without\\n  wrapping them in ``MaxRetryError``.
        (Issue #348)\\n\\n* Fixed open socket leak with SSL-related failures. (Issue
        #344, #348)\\n\\n\\n1.7.1 (2013-09-25)\\n------------------\\n\\n* Added granular
        timeout support with new ``urllib3.util.Timeout`` class.\\n  (Issue #231)\\n\\n*
        Fixed Python 3.4 support. (Issue #238)\\n\\n\\n1.7 (2013-08-14)\\n----------------\\n\\n*
        More exceptions are now pickle-able, with tests. (Issue #174)\\n\\n* Fixed
        redirecting with relative URLs in Location header. (Issue #178)\\n\\n* Support
        for relative urls in ``Location: ...`` header. (Issue #179)\\n\\n* ``urllib3.response.HTTPResponse``
        now inherits from ``io.IOBase`` for bonus\\n  file-like functionality. (Issue
        #187)\\n\\n* Passing ``assert_hostname=False`` when creating a HTTPSConnectionPool
        will\\n  skip hostname verification for SSL connections. (Issue #194)\\n\\n*
        New method ``urllib3.response.HTTPResponse.stream(...)`` which acts as a\\n
        \ generator wrapped around ``.read(...)``. (Issue #198)\\n\\n* IPv6 url parsing
        enforces brackets around the hostname. (Issue #199)\\n\\n* Fixed thread race
        condition in\\n  ``urllib3.poolmanager.PoolManager.connection_from_host(...)``
        (Issue #204)\\n\\n* ``ProxyManager`` requests now include non-default port
        in ``Host: ...``\\n  header. (Issue #217)\\n\\n* Added HTTPS proxy support
        in ``ProxyManager``. (Issue #170 #139)\\n\\n* New ``RequestField`` object
        can be passed to the ``fields=...`` param which\\n  can specify headers. (Issue
        #220)\\n\\n* Raise ``urllib3.exceptions.ProxyError`` when connecting to proxy
        fails.\\n  (Issue #221)\\n\\n* Use international headers when posting file
        names. (Issue #119)\\n\\n* Improved IPv6 support. (Issue #203)\\n\\n\\n1.6
        (2013-04-25)\\n----------------\\n\\n* Contrib: Optional SNI support for Py2
        using PyOpenSSL. (Issue #156)\\n\\n* ``ProxyManager`` automatically adds ``Host:
        ...`` header if not given.\\n\\n* Improved SSL-related code. ``cert_req``
        now optionally takes a string like\\n  \\\"REQUIRED\\\" or \\\"NONE\\\". Same
        with ``ssl_version`` takes strings like \\\"SSLv23\\\"\\n  The string values
        reflect the suffix of the respective constant variable.\\n  (Issue #130)\\n\\n*
        Vendored ``socksipy`` now based on Anorov's fork which handles unexpectedly\\n
        \ closed proxy connections and larger read buffers. (Issue #135)\\n\\n* Ensure
        the connection is closed if no data is received, fixes connection leak\\n
        \ on some platforms. (Issue #133)\\n\\n* Added SNI support for SSL/TLS connections
        on Py32+. (Issue #89)\\n\\n* Tests fixed to be compatible with Py26 again.
        (Issue #125)\\n\\n* Added ability to choose SSL version by passing an ``ssl.PROTOCOL_*``
        constant\\n  to the ``ssl_version`` parameter of ``HTTPSConnectionPool``.
        (Issue #109)\\n\\n* Allow an explicit content type to be specified when encoding
        file fields.\\n  (Issue #126)\\n\\n* Exceptions are now pickleable, with tests.
        (Issue #101)\\n\\n* Fixed default headers not getting passed in some cases.
        (Issue #99)\\n\\n* Treat \\\"content-encoding\\\" header value as case-insensitive,
        per RFC 2616\\n  Section 3.5. (Issue #110)\\n\\n* \\\"Connection Refused\\\"
        SocketErrors will get retried rather than raised.\\n  (Issue #92)\\n\\n* Updated
        vendored ``six``, no longer overrides the global ``six`` module\\n  namespace.
        (Issue #113)\\n\\n* ``urllib3.exceptions.MaxRetryError`` contains a ``reason``
        property holding\\n  the exception that prompted the final retry. If ``reason
        is None`` then it\\n  was due to a redirect. (Issue #92, #114)\\n\\n* Fixed
        ``PoolManager.urlopen()`` from not redirecting more than once.\\n  (Issue
        #149)\\n\\n* Don't assume ``Content-Type: text/plain`` for multi-part encoding
        parameters\\n  that are not files. (Issue #111)\\n\\n* Pass `strict` param
        down to ``httplib.HTTPConnection``. (Issue #122)\\n\\n* Added mechanism to
        verify SSL certificates by fingerprint (md5, sha1) or\\n  against an arbitrary
        hostname (when connecting by IP or for misconfigured\\n  servers). (Issue
        #140)\\n\\n* Streaming decompression support. (Issue #159)\\n\\n\\n1.5 (2012-08-02)\\n----------------\\n\\n*
        Added ``urllib3.add_stderr_logger()`` for quickly enabling STDERR debug\\n
        \ logging in urllib3.\\n\\n* Native full URL parsing (including auth, path,
        query, fragment) available in\\n  ``urllib3.util.parse_url(url)``.\\n\\n*
        Built-in redirect will switch method to 'GET' if status code is 303.\\n  (Issue
        #11)\\n\\n* ``urllib3.PoolManager`` strips the scheme and host before sending
        the request\\n  uri. (Issue #8)\\n\\n* New ``urllib3.exceptions.DecodeError``
        exception for when automatic decoding,\\n  based on the Content-Type header,
        fails.\\n\\n* Fixed bug with pool depletion and leaking connections (Issue
        #76). Added\\n  explicit connection closing on pool eviction. Added\\n  ``urllib3.PoolManager.clear()``.\\n\\n*
        99% -> 100% unit test coverage.\\n\\n\\n1.4 (2012-06-16)\\n----------------\\n\\n*
        Minor AppEngine-related fixes.\\n\\n* Switched from ``mimetools.choose_boundary``
        to ``uuid.uuid4()``.\\n\\n* Improved url parsing. (Issue #73)\\n\\n* IPv6
        url support. (Issue #72)\\n\\n\\n1.3 (2012-03-25)\\n----------------\\n\\n*
        Removed pre-1.0 deprecated API.\\n\\n* Refactored helpers into a ``urllib3.util``
        submodule.\\n\\n* Fixed multipart encoding to support list-of-tuples for keys
        with multiple\\n  values. (Issue #48)\\n\\n* Fixed multiple Set-Cookie headers
        in response not getting merged properly in\\n  Python 3. (Issue #53)\\n\\n*
        AppEngine support with Py27. (Issue #61)\\n\\n* Minor ``encode_multipart_formdata``
        fixes related to Python 3 strings vs\\n  bytes.\\n\\n\\n1.2.2 (2012-02-06)\\n------------------\\n\\n*
        Fixed packaging bug of not shipping ``test-requirements.txt``. (Issue #47)\\n\\n\\n1.2.1
        (2012-02-05)\\n------------------\\n\\n* Fixed another bug related to when
        ``ssl`` module is not available. (Issue #41)\\n\\n* Location parsing errors
        now raise ``urllib3.exceptions.LocationParseError``\\n  which inherits from
        ``ValueError``.\\n\\n\\n1.2 (2012-01-29)\\n----------------\\n\\n* Added Python
        3 support (tested on 3.2.2)\\n\\n* Dropped Python 2.5 support (tested on 2.6.7,
        2.7.2)\\n\\n* Use ``select.poll`` instead of ``select.select`` for platforms
        that support\\n  it.\\n\\n* Use ``Queue.LifoQueue`` instead of ``Queue.Queue``
        for more aggressive\\n  connection reusing. Configurable by overriding ``ConnectionPool.QueueCls``.\\n\\n*
        Fixed ``ImportError`` during install when ``ssl`` module is not available.\\n
        \ (Issue #41)\\n\\n* Fixed ``PoolManager`` redirects between schemes (such
        as HTTP -> HTTPS) not\\n  completing properly. (Issue #28, uncovered by Issue
        #10 in v1.1)\\n\\n* Ported ``dummyserver`` to use ``tornado`` instead of ``webob``
        +\\n  ``eventlet``. Removed extraneous unsupported dummyserver testing backends.\\n
        \ Added socket-level tests.\\n\\n* More tests. Achievement Unlocked: 99% Coverage.\\n\\n\\n1.1
        (2012-01-07)\\n----------------\\n\\n* Refactored ``dummyserver`` to its own
        root namespace module (used for\\n  testing).\\n\\n* Added hostname verification
        for ``VerifiedHTTPSConnection`` by vendoring in\\n  Py32's ``ssl_match_hostname``.
        (Issue #25)\\n\\n* Fixed cross-host HTTP redirects when using ``PoolManager``.
        (Issue #10)\\n\\n* Fixed ``decode_content`` being ignored when set through
        ``urlopen``. (Issue\\n  #27)\\n\\n* Fixed timeout-related bugs. (Issues #17,
        #23)\\n\\n\\n1.0.2 (2011-11-04)\\n------------------\\n\\n* Fixed typo in
        ``VerifiedHTTPSConnection`` which would only present as a bug if\\n  you're
        using the object manually. (Thanks pyos)\\n\\n* Made RecentlyUsedContainer
        (and consequently PoolManager) more thread-safe by\\n  wrapping the access
        log in a mutex. (Thanks @christer)\\n\\n* Made RecentlyUsedContainer more
        dict-like (corrected ``__delitem__`` and\\n  ``__getitem__`` behaviour), with
        tests. Shouldn't affect core urllib3 code.\\n\\n\\n1.0.1 (2011-10-10)\\n------------------\\n\\n*
        Fixed a bug where the same connection would get returned into the pool twice,\\n
        \ causing extraneous \\\"HttpConnectionPool is full\\\" log warnings.\\n\\n\\n1.0
        (2011-10-08)\\n----------------\\n\\n* Added ``PoolManager`` with LRU expiration
        of connections (tested and\\n  documented).\\n* Added ``ProxyManager`` (needs
        tests, docs, and confirmation that it works\\n  with HTTPS proxies).\\n* Added
        optional partial-read support for responses when\\n  ``preload_content=False``.
        You can now make requests and just read the headers\\n  without loading the
        content.\\n* Made response decoding optional (default on, same as before).\\n*
        Added optional explicit boundary string for ``encode_multipart_formdata``.\\n*
        Convenience request methods are now inherited from ``RequestMethods``. Old\\n
        \ helpers like ``get_url`` and ``post_url`` should be abandoned in favour
        of\\n  the new ``request(method, url, ...)``.\\n* Refactored code to be even
        more decoupled, reusable, and extendable.\\n* License header added to ``.py``
        files.\\n* Embiggened the documentation: Lots of Sphinx-friendly docstrings
        in the code\\n  and docs in ``docs/`` and on urllib3.readthedocs.org.\\n*
        Embettered all the things!\\n* Started writing this file.\\n\\n\\n0.4.1 (2011-07-17)\\n------------------\\n\\n*
        Minor bug fixes, code cleanup.\\n\\n\\n0.4 (2011-03-01)\\n----------------\\n\\n*
        Better unicode support.\\n* Added ``VerifiedHTTPSConnection``.\\n* Added ``NTLMConnectionPool``
        in contrib.\\n* Minor improvements.\\n\\n\\n0.3.1 (2010-07-13)\\n------------------\\n\\n*
        Added ``assert_host_name`` optional parameter. Now compatible with proxies.\\n\\n\\n0.3
        (2009-12-10)\\n----------------\\n\\n* Added HTTPS support.\\n* Minor bug
        fixes.\\n* Refactored, broken backwards compatibility with 0.2.\\n* API to
        be treated as stable from this version forward.\\n\\n\\n0.2 (2008-11-17)\\n----------------\\n\\n*
        Added unit tests.\\n* Bug fixes.\\n\\n\\n0.1 (2008-11-16)\\n----------------\\n\\n*
